import './App.css';
import logo from './logo.png';
import homeScreen from './homeScreen.jpg'
import axios from "axios";
import React from "react";
import { useState, useEffect } from "react";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import specialEventParkingImage from "./specialEventParkingImage.jpg"
import golfCartServicesImage from "./specialEventParkingImage.jpg"
import logo1 from "./logo1.png"
import logo2 from "./logo2.png"
import logo3 from "./logo3.png"
import logo4 from "./logo4.png"
import logo5 from "./logo5.png"
import logo6 from "./logo6.png"
import logo7 from "./logo6.png"
import logo8 from "./logo6.png"
import { useRef } from 'react';




export function HomePage() {

const ServicesSection = () => {
    return (
        <div className="services-container">
          <div className="service special-event-parking">
            <img src={specialEventParkingImage} alt="Special Event Parking" />
            <div className="service-info">
              <h2>Special Event Parking</h2>
              <p>Parking teams are dispatched to event locations to coordinate all aspects of parking and transportation. The San Francisco-based production team will analyze the event location and propose a parking and transportation solution.</p>
              <button>Learn more</button>
            </div>
          </div>
          <div className="service golf-cart-services">
            <img src={golfCartServicesImage} alt="Golf Cart Services" />
            <div className="service-info">
              <h2>Golf Cart Services</h2>
              <p>Courteous and professional drivers provide golf cart service for event guests and patrons with limited mobility. Golf cart service is particularly useful in challenging parking scenarios.</p>
              <button>Learn more</button>
            </div>
          </div>
        </div>
      );
    }

const LogoBar = () => {
    const logos = [logo1, logo2, logo3, logo4, logo5, logo6];
    return (
      <div className="logo-bar-container">
        <div className="logo-bar">
          {logos.map((logo, index) => (
            <img key={index} src={logo} alt="Company Logo" />
          ))}
          {/* Repeat the logos for a smoother transition */}
          {logos.map((logo, index) => (
            <img key={'copy-' + index} src={logo} alt="Company Logo" />
          ))}
        </div>
      </div>
    );
  }




const Image = () => {
    return (
      <div className="main-container">
        <div className="image-container" >
          <img src={homeScreen} alt="Commercial Services" />
          <div className="image-overlay">
            <h1>Commercial Services</h1>
          </div>
        </div>
      </div>
    );
  }


  const Footer = () => {
        return (
          <footer className="footer">
            <Container>
              <Row>
                <Col md={3} sm={6}>
                  <h5>Peninsula Parking</h5>
                  <p><i className="fas fa-phone"></i> 650-508-8886</p>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Services</h5>
                  <ul>
                    <li>Valet Parking</li>
                    <li>Commercial Services</li>
                    <li>Airport Valet Parking</li>
                    {/* Add more services as needed */}
                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Company</h5>
                  <ul>
                    <li>Employment</li>
                    <li>Partners</li>
                    <li>About Us</li>
                    <li>Contact Us</li>
                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Locations</h5>
                  <ul>
                    <li>Menlo Park Valet Parking Services</li>
                    <li>Palo Alto Valet Parking Services</li>
                    {/* Add more locations as needed */}
                  </ul>
                </Col>
              </Row>
            </Container>
          </footer>
        );
      }




return (

    <div>

     <nav className="navbar">
       <div className="logo">
         <img className="h-10 mr-3" style={{ width: '150px', height: '150px', padding: '5px' }} src={logo} alt="Logo" />
       </div>
       <ul className="nav-links">
         <li><a href="/valet-parking">Valet Parking</a></li>
         <li><a href="/commercial-services">Commercial Services</a></li>
         <li><a href="/locations">Locations</a></li>
         <li><a href="/careers">Careers</a></li>
         <li><a href="/about">About</a></li>
         <li><a href="/ContactPage">Contact</a></li>
       </ul>
       <button className="quote-btn" style={{ padding:'20px', color:'black', fontSize:'20px'}}> <a href="Quote" style={{color:'black' }}>Request a Quote</a> </button>

     </nav>
     <div style={{padding:'200px'}}>
       {Image()}
       {ServicesSection()}
       {LogoBar()}
         </div>

         <div >
       {Footer()}
         </div>
       </div> 


   );





}
export default HomePage;
